import React from "react";
import { Text, StyleSheet, View} from "react-native";



const BoxScreen = () => {
        

    return( 
    
    <View>
        <Text>Box screen</Text>

        
    </View>
    
    );


};

const styles = StyleSheet.create({

    viewStyle: {

        borderWidth: 3,
        borderColor: 'black'

    },

    textStyle: {

        
        borderWidth: 1,
        borderColor: 'red',
        marginVertical: 20
    }



}) ;


export default BoxScreen;
